import React from 'react';
import './Footer.css';

export const Footer = () => {
  return (
    <div className="footer">
        Nexopedia &copy; 2022 Adam Schellenberg. <br />
        All Nexomon game images are property of <a href="https://pqube.co.uk/nexomon-extinction/" target="_blank">
            Vewo Interactive Inc.
            </a>
    </div>
  )
}
